import React from "react";
import "./styledButton.css";

const StyledButton = () => {
  var ButtonText = "Click me";

  function buttonHandler() {
    console.log("clicked");
    ButtonText = "CLICKED!";
    return ButtonText;
  }

  return (
    <button className='styledButton' onClick={() => buttonHandler()}>
      {ButtonText}
    </button>
  );
};

export default StyledButton;
